import React from 'react';

const Footer = () => {
  return (
    <footer style={{
      backgroundColor: '#2c3e50',
      color: 'white',
      textAlign: 'center',
      padding: '20px',
      marginTop: 'auto'
    }}>
      <p>&copy; 2024 Hospital Management System. All rights reserved.</p>
    </footer>
  );
};

export default Footer;
